textOriginal:
A gente sabe que o quanto o Bob Jeff é privilegiado quando percebe que a PF veio prender ele e não é naquele horário ingrato de 6h da manhã. 

E apenas uma correção Ian: A prisão do Bob Jeff foi decretada pelas inúmeras violações as condições da prisão domiciliar. Claro que teve um componente de defesa corporativa quando o Xandão decretou a prisão após o Roberto Jefferson publicar 15° vídeo em redes sociais (da filha dele kkk) violando a condicional xingando a Carmén Lúcia de forma misógina e nojenta, mas a prisão não é pelo fato de xingar a Carmen Lúcia.

Se não bastasse a violação a prisão domiciliar por ficar postando conteúdo em redes sociais e manter contato com pessoas proibidas o Bob Jeff:

1 - Tinha armas tendo licença de CAC vencida;

2 - Atirou granadas que eram bombas de efeito moral e cuja posse só é legal com autorização;

3 - Resistência violenta a prisão;

4 - Tentativa de homicídio aos 4 agentes da PF;

5 - Lesão corporal a 2 dos 4 agentes;

5 - Dano ao patrimônio público ao destruir uma viatura blindada;

Espero que essas bolas do Bolsonaro sejam muito gostosas, pois ele se enrolou muito ao chupar elas nesse domingo 👍
